import './App.css';
import HomePage from './HomePage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>E-commerce Website</h1>
        <button onClick={HomePage.handleHome}>Home</button> {/* Add the Home button */}
      </header>
      <main>
        <HomePage />
      </main>
    </div>
  );
}

export default App;
